"     <a class=\"medical medical_review\" href=\"UTD.htm?26/60/27592?source=related_link\">",
"      Basic principles and safety of diagnostic ultrasound in obstetrics and gynecology",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?10/30/10728?source=related_link\">",
"      Doppler ultrasound of the umbilical artery for fetal surveillance",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?11/31/11768?source=related_link\">",
"      Fetal blood sampling",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?23/27/23994?source=related_link\">",
"      Fetal growth restriction: Evaluation and management",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?23/7/23674?source=related_link\">",
"      Intrapartum fetal heart rate assessment",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?25/13/25815?source=related_link\">",
"      Nuchal cords",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?13/57/14233?source=related_link\">",
"      Oligohydramnios",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?23/40/24202?source=related_link\">",
"      Overview of the general approach to diagnosis and treatment of fetal cardiac arrhythmias",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?11/41/11928?source=related_link\">",
"      The fetal biophysical profile",
"     </a>",
