"   <div class=\"block pha drugH1Div\" id=\"F204231\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Oxaliplatin, a platinum derivative, is an alkylating agent. Following intracellular hydrolysis, the platinum compound binds to DNA forming cross-links which inhibit DNA replication and transcription, resulting in cell death. Cytotoxicity is cell-cycle nonspecific.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F204246\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : 440 L",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: &gt;90% primarily albumin and gamma globulin (irreversible binding to platinum)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Nonenzymatic (rapid and extensive), forms active and inactive derivatives",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: Terminal: 391 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (~54%); feces (~2%)",
"    </p>",
"   </div>",
