" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Investigational biologic markers in the diagnosis and assessment of rheumatoid arthritis",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?2/11/2234/contributors\">",
