"     Peter C Taylor, MA, PhD, FRCP",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?2/11/2234/contributors\">",
"     RN Maini, BA, MB BChir, FRCP, FMedSci, FRS",
"    </a>",
