var title_f2_11_2237="Banff diagnostic criteria reject allograft nephropathy";
var content_f2_11_2237=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F52378&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F52378&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Banff diagnostic criteria for rejection and allograft nephropathy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        1. Normal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"1\">",
"        2. Antibody-mediated rejection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        Rejection: due, at least in part, to documented",
"anti-donor antibody (suspicious for if antibody not demonstrated). May",
"coincide with categories 3, 4 and 5 - see below",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Type (grade)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1. ATN-like - C4d+, minimal inflammation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2. Capillary - C4d+, capillary margination and/or thrombosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3.&nbsp;Arterial - C4d+, transmural arteritis (v3) (see section 4, grade III below)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        3. Borderline changes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        Suspicious for acute cellular rejection. No",
"intimal arteritis ispresent, but there are foci of mile tubulitis (1-4",
"mononuclear cells/tubular cross-section). May coincide with categories",
"2 and 5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        4. Acute/active cellular rejection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        T-cell mediated rejection; may coincide with categories 2 and 5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Type (grade) of histopathological findings:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1A Cases with significant interstitial infiltration (&gt;25% of parenchyma affected) and foci of moderate tubulitis (&gt;4",
"mononuclear cells/tubular cross section or group of 10 tubular cells)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1B Cases with significant interstitial infiltration (&gt;25% of parenchyma affected) and foci of severe tubulitis (&gt;10",
"mononuclear cells/tubular cross-section or group of 10 tubular cells)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2A Cases with mild to moderate intimal arteritis (v1)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        2B Cases with severe intimal arteritis comprising &gt;25% of the luminal area (v2)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        3 Cases with transmural arteritis and/or arterial fibrinoid change and necrosis of medial smooth muscle cells with accompanying lymphocytic inflammation (v3)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        5. Chronic/sclerosing allograft nephropathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        Fibrosing changes in the allograft, with or",
"without features of true alloimmune injury to the graft; may coincide",
"with categories 2, 3 and 4.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"1\">",
"        Mild interstitial fibrosis and tubular atrophy without (a) or with (b) specific changes suggesting chronic (mild) rejection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade 2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Moderate interstitial fibrosis and tubular atrophy (a) or (b) (moderate)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade 3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"1\">",
"        Severe interstitial fibrosis and tubular atrophy and tubular loss (a) or (b) (severe)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        6. Other",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\">",
"        Changes not considered to be due to rejection; may coincide with categories 2, 3, 4 and 5.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Modified from: Racusen, CR, Solez, K, Mihatsch, MJ, et al. Am J Transplant 2003; 3:708.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f2_11_2237=[""].join("\n");
