var title_f2_11_2238="Inherited metabolic disease";
var content_f2_11_2238=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F67880&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F67880&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Transplantation of allogeneic hepatocytes in patients with inherited metabolic diseases (n=16)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Diagnosis, [reference]",
"       </td>",
"       <td class=\"subtitle1\">",
"        Age",
"       </td>",
"       <td class=\"subtitle1\">",
"        Procedure and outcome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Alpha-1 antitrypsin-deficiency (with cirrhosis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        [1,2]",
"       </td>",
"       <td>",
"        4.5 months",
"       </td>",
"       <td>",
"        Intraportal infusion. OLT after 4 days.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Crigler-Najjar syndrome type 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        [3]",
"       </td>",
"       <td>",
"        10 years",
"       </td>",
"       <td>",
"        Intraportal (7.5x10",
"        <sup>",
"         9",
"        </sup>",
"        hepatocytes). Total bilirubin 50 percent &darr;. Bilirubin glucuronides detected in bile up to 3.5 years. Auxilliary liver transplantation at 4 years.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        [4]",
"       </td>",
"       <td>",
"        2 weeks-3 months",
"       </td>",
"       <td>",
"        4.3x10",
"        <sup>",
"         9",
"        </sup>",
"        (cryopreserved): 9 infusions at 2 weeks; 1 infusion at 3 months. At 9 months total bilirubin  40 percent &darr;.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        [5]",
"       </td>",
"       <td>",
"        9 years",
"       </td>",
"       <td>",
"        Intraportal (3.5x10",
"        <sup>",
"         9",
"        </sup>",
"        + 4x10",
"        <sup>",
"         9",
"        </sup>",
"        cells over 2 hours), total bilirubin 50 percent &darr;. OLT after 4.6 months.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        [1]",
"       </td>",
"       <td>",
"        8 years",
"       </td>",
"       <td>",
"        Intraportal (1.5x10",
"        <sup>",
"         9",
"        </sup>",
"        cells over 1 hour). Total bilirubin 30 percent &darr;.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Factor VII deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        [6]",
"       </td>",
"       <td>",
"        -",
"       </td>",
"       <td>",
"        Intraportal in two brothers (1x10",
"        <sup>",
"         9",
"        </sup>",
"        fresh cells and 2.2x10",
"        <sup>",
"         9",
"        </sup>",
"        cryopreserved cells). Exogenous FVII reqirement 80 percent &darr;. OLT after 6 months.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Glycogen storage disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        [7]",
"       </td>",
"       <td>",
"        Child",
"       </td>",
"       <td>",
"        Intraportal infusion. On normal diet with no hypoglycemic episode after transplantation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        [1]",
"       </td>",
"       <td>",
"        18 years",
"       </td>",
"       <td>",
"        Intraportal (3x10",
"        <sup>",
"         9",
"        </sup>",
"        cells), 3 infusions at one-week intervals, one infusion (3x10",
"        <sup>",
"         9",
"        </sup>",
"        cells) after 1 month from a second donor. Glucose-6-phosphatase activity normal 3 weeks and 7 months later.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Infantile refsum's disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        [8]",
"       </td>",
"       <td>",
"        4 years",
"       </td>",
"       <td>",
"        Intraportal (2x10",
"        <sup>",
"         9",
"        </sup>",
"        cells, 8 infusions). Pipecholic acid &darr;. Engrafted hepatocyte mass 0.25 percent (by SRY-PCR).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Progressive familial intrahepatic cholestasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        [4]",
"       </td>",
"       <td>",
"        Two children",
"       </td>",
"       <td>",
"        Intraportal (3x10",
"        <sup>",
"         8",
"        </sup>",
"        fresh cells, each). No improvement. OLT at 5 and 14 months, respectively.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Ornithine transcarbamylase deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        [9]",
"       </td>",
"       <td>",
"        5 years",
"       </td>",
"       <td>",
"        Intraportal (1x10",
"        <sup>",
"         9",
"        </sup>",
"        fresh cells). OTC 0.5 percent of normal on biopsy at day 28. Died of sepsis at day 42.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        [10]",
"       </td>",
"       <td>",
"        Two infants",
"       </td>",
"       <td>",
"        Intraportal (4x10",
"        <sup>",
"         9",
"        </sup>",
"        fresh cells). NH",
"        <sub>",
"         3",
"        </sub>",
"        &darr; for 11 days. OLT.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        [11]",
"       </td>",
"       <td>",
"        Newborn",
"       </td>",
"       <td>",
"        Infused through  umbilical vein (1.9x10",
"        <sup>",
"         9",
"        </sup>",
"        cells). Normal NH",
"        <sub>",
"         3",
"        </sub>",
"        on normal protein diet. OLT at 7 months with no neurological abnormality.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Citrulinemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        [1]",
"       </td>",
"       <td>",
"        2 years and 1 month",
"       </td>",
"       <td>",
"        Intraportal (1x10",
"        <sup>",
"         9",
"        </sup>",
"        cells, 3 months later, 2x10",
"        <sup>",
"         9",
"        </sup>",
"        cells from a second donor). Citruline and NH",
"        <sub>",
"         3",
"        </sub>",
"        &darr; at 2 weeks and 6 months.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     1. Fisher RA, Strom SC. Human hepatocyte Transplantation: Worldwide results. Transplantation 2006; 82:441.",
"     <br>",
"      2. Strom SC, Chowdhury JR, Fox IJ. Hepatocyte transplantation for the treatment of human disease. Semin Liver Dis 1999; 19:39.",
"      <br>",
"       3. Fox IJ, Roy-Chowdhury J, Kaufman SS, et al. Treatment of the Crigler-Najjar syndrome type I with hepatocyte transplantation. N Engl J Med 1998; 338:1422.",
"       <br>",
"        4. Hughes RD, Mitry RR, Dhawan A. Hepatocyte transplantation for metabolic liver disease: UK experience. J Royal Soc Med 2005; 98:341.",
"        <br>",
"         5. Ambrosino G, Varotto S, Strom SC, et al. Isolated hepatocyte transplantation for Crigler-Najjar Syndrome Type 1. Cell Transplantation 2005; 14:151.",
"         <br>",
"          6. Dhawan A, Mitry RR, Hughes RD, et al. Hepatocyte transplantation for inherited factor VII deficiency. Transplantation 2004; 78:1812.",
"          <br>",
"           7. Muraca M, Gerunda G, Neri D, et al. Hepatocyte transplantation as a treatment for glycogen storage disease type 1a. Lancet 2002; 359:317.",
"           <br>",
"            8. Sokal EM, Smets F, Bourgois A, et al. Hepatocyte transplantation in a 4-year-old girl with peroxisomal biogenesis disease: technique, safety, and metabolic follow-up. Transplantation 2003; 76:735.",
"            <br>",
"             9. Strom SC, Fisher RA, Rubinstein WS, et al. Transplantation of human hepatocytes. Transplant Proc 1997; 29:2103.",
"             <br>",
"              10. Horslen SP, McCowan TC, Goertzen TC, et al. Isolated hepatocyte transplantation in an infant with a severe urea cycle disorder. Pediatrics 2003; 111:1262.",
"              <br>",
"               11. Mitry RR, Dhawan A, Hughes RD, et al. One liver, three recipients-segment IV from split liver procedure as a source of hepatocytes for cell transplantation. Transplantation 2004; 77:1614.",
"              </br>",
"             </br>",
"            </br>",
"           </br>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
